import React from "react";
import styled from "styled-components";
const Page = (props) => {
    return (
        <Component>
            <div className='padding' />
            {props.children}
        </Component>
    );
};
const Component = styled.div`
    min-height: 100vh;
    min-height: calc(var(--vh, 1vh) * 100);
    background-color: red;
    .padding {
        padding-top: 96px;
    }
`;
export default Page;
